import "./emptyclass.css"
import { useNavigate } from "react-router-dom"
import Building from "./building/building";
import axios from "axios";
import { useState } from 'react';

const emptyclass = () => {
    const navigate = useNavigate();
    const [activeBuilding, setActiveBuilding] = useState(null);

    function emptyHandler() {
        navigate("/home/")
    }
    function handleBuildingClick(buildingId) {
        setActiveBuilding(buildingId);
        // Reset the background color of all buttons
        const buttons = document.getElementsByClassName('buildingbtn');
        for(let i = 0; i < buttons.length; i++) {
            buttons[i].style.backgroundColor = '';
        }
        // Set the background color of the clicked button to orange
        document.getElementById(`btn${buildingId}`).style.backgroundColor = 'rgb(246,195,66)';
    }
    axios({
        method: "get",
        url: '/api/empty_room',
        headers: {
            "Content-Type": 'application/form-data',
            "traefik": "jwzx",
        },
    }).then(res => {
        console.log(res);
    }, err => {
        console.log(err)
    });

    return (
        <div id="empty-bg" >
            <div id="emphead">
                <button id="empbtn" onClick={emptyHandler}><img src={require("./emptypic/returnarrow.png")} id="emparr" /></button>
                空闲教室
            </div>
            {activeBuilding === 'build2' && <div className="emptychoice" id="build2">
                <div className="floordiv" id="f1div"><img src={require("./emptypic/1f.jpg")} id="f1" className="buildingpic" /></div>
                <div className="floordiv" id="f2div"><img src={require("./emptypic/2f.jpg")} id="f2" className="buildingpic" /></div>
                <div className="floordiv" id="f3div"><img src={require("./emptypic/3f.jpg")} id="f3" className="buildingpic" /></div>
                <div className="floordiv" id="f4div"><img src={require("./emptypic/4f.jpg")} id="f4" className="buildingpic" /></div>
                <div className="floordiv" id="f5div"><img src={require("./emptypic/5f.jpg")} id="f5" className="buildingpic" /></div>
            </div>}
            {activeBuilding === 'build3' && <div className="emptychoice" id="build3">
                <div className="floordiv" id="f1div"><img src={require("./emptypic/1f.jpg")} id="f1" className="buildingpic" /></div>
                <div className="floordiv" id="f2div"><img src={require("./emptypic/2f.jpg")} id="f2" className="buildingpic" /></div>
                <div className="floordiv" id="f3div"><img src={require("./emptypic/3f.jpg")} id="f3" className="buildingpic" /></div>
                <div className="floordiv" id="f4div"><img src={require("./emptypic/4f.jpg")} id="f4" className="buildingpic" /></div>
                <div className="floordiv" id="f5div"><img src={require("./emptypic/5f.jpg")} id="f5" className="buildingpic" /></div>
            </div>}
            {activeBuilding === 'build4' && <div className="emptychoice" id="build4">
                <div className="floordiv" id="f1div"><img src={require("./emptypic/1f.jpg")} id="f1" className="buildingpic" /></div>
                <div className="floordiv" id="f2div"><img src={require("./emptypic/2f.jpg")} id="f2" className="buildingpic" /></div>
                <div className="floordiv" id="f3div"><img src={require("./emptypic/3f.jpg")} id="f3" className="buildingpic" /></div>
                <div className="floordiv" id="f4div"><img src={require("./emptypic/4f.jpg")} id="f4" className="buildingpic" /></div>
                <div className="floordiv" id="f5div"><img src={require("./emptypic/5f.jpg")} id="f5" className="buildingpic" /></div>
            </div>}
            {activeBuilding === 'build5' && <div className="emptychoice" id="build5">
                <div className="floordiv" id="f2div"><img src={require("./emptypic/2f.jpg")} id="f2" className="buildingpic" /></div>
                <div className="floordiv" id="f3div"><img src={require("./emptypic/3f.jpg")} id="f3" className="buildingpic" /></div>
                <div className="floordiv" id="f4div"><img src={require("./emptypic/4f.jpg")} id="f4" className="buildingpic" /></div>
                <div className="floordiv" id="f5div"><img src={require("./emptypic/5f.jpg")} id="f5" className="buildingpic" /></div>
            </div>}
            {activeBuilding === 'build8' && <div className="emptychoice" id="build8">
                <div className="floordiv" id="f1div"><img src={require("./emptypic/1f.jpg")} id="f1" className="buildingpic" /></div>
                <div className="floordiv" id="f2div"><img src={require("./emptypic/2f.jpg")} id="f2" className="buildingpic" /></div>
            </div>}
            <div id="classchoice">
                <div id="building">
                <div className="buildingbtndiv"><button id="btnbuild2" className="buildingbtn" onClick={() => handleBuildingClick('build2')}>二教</button></div>
                   <div className="buildingbtndiv"><button id="btnbuild3" className="buildingbtn" onClick={() => handleBuildingClick('build3')}>三教</button></div>
                   <div className="buildingbtndiv"><button id="btnbuild4" className="buildingbtn" onClick={() => handleBuildingClick('build4')}>四教</button></div>
                   <div className="buildingbtndiv"><button id="btnbuild5" className="buildingbtn" onClick={() => handleBuildingClick('build5')}>五教</button></div>
                   <div className="buildingbtndiv"><button id="btnbuild8" className="buildingbtn" onClick={() => handleBuildingClick('build8')}>八教</button></div>
                </div>
            </div>
        </div>)
}
export default emptyclass;
